fn full_mul_add(self, other: $ty, other2: $ty, carry: $ty) -> ($ty, $ty) {
                    // This cannot overflow;
                    // the output is between `0` and `2^nbits * (2^nbits - 1)`.
                    let (lo, hi) = self.carrying_mul_add(other, other2, carry);
                    (hi, lo)
                }
